INSERT INTO `ps_product_lang` VALUES
('1','1','1','\"Smartfon Xiaomi Redmi 10 64 GB Carbon Gray\nXiaomi Redmi 10 64 GB Carbon Gray swoim wyglądem i możliwościami wprowadza rewolucje do całej serii tych smartfonów. Jego stylowy i profesjonalny design można śmiało przyrównać do flagowych modeli. Napędzany najnowszym procesorem MediaTek G88 i z baterią 5000 mAh zapewni Ci płynną pracę nawet przez cały dzień. A gdy najdzie Cię ochota, oglądaj filmy na 6,5\" ekranie z odświeżaniem 90 Hz lub cyknij parę wysokiej jakości zdjęć. System czterech obiektywów z matrycą główna 50 Mpix jest do Twojej dyspozycji.\"',NULL,'xiaomi-redmi-10-4-64gb-carbon-gray-90hz',NULL,NULL,NULL,'Xiaomi Redmi 10 4/64GB Carbon Gray 90Hz',NULL,NULL,NULL,NULL),
('1','1','2','\"Smartfon Xiaomi Redmi 10 64 GB Carbon Gray\nXiaomi Redmi 10 64 GB Carbon Gray swoim wyglądem i możliwościami wprowadza rewolucje do całej serii tych smartfonów. Jego stylowy i profesjonalny design można śmiało przyrównać do flagowych modeli. Napędzany najnowszym procesorem MediaTek G88 i z baterią 5000 mAh zapewni Ci płynną pracę nawet przez cały dzień. A gdy najdzie Cię ochota, oglądaj filmy na 6,5\" ekranie z odświeżaniem 90 Hz lub cyknij parę wysokiej jakości zdjęć. System czterech obiektywów z matrycą główna 50 Mpix jest do Twojej dyspozycji.\"',NULL,'xiaomi-redmi-10-4-64gb-carbon-gray-90hz',NULL,NULL,NULL,'Xiaomi Redmi 10 4/64GB Carbon Gray 90Hz',NULL,NULL,NULL,NULL),
('2','1','1','\"Smartfon Xiaomi Redmi Note 11S 128 GB Graphite Gray\nXiaomi Redmi Note 11S 128 GB Graphite Gray to elegancki smartfon, w którym zamknięta została pojemna bateria. Dzięki niemu możesz spotykać się ze znajomymi online i rywalizować z wirtualnymi przeciwnikami, jak długo chcesz. Poczwórny aparat to niczym nieograniczone twórcze możliwości. Włącz ulubiony serial na dużym i jasnym ekranie i rozkoszuj się wizualną ucztą dzięki szerokiej gamie kolorów DCI-P3.\"',NULL,'xiaomi-redmi-note-11s-6-128gb-graphite-gray',NULL,NULL,NULL,'Xiaomi Redmi Note 11S 6/128GB Graphite Gray',NULL,NULL,NULL,NULL),
('2','1','2','<p>\"Smartfon Xiaomi Redmi Note 11S 128 GB Graphite Gray Xiaomi Redmi Note 11S 128 GB Graphite Gray to elegancki smartfon, w którym zamknięta została pojemna bateria. Dzięki niemu możesz spotykać się ze znajomymi online i rywalizować z wirtualnymi przeciwnikami, jak długo chcesz. Poczwórny aparat to niczym nieograniczone twórcze możliwości. Włącz ulubiony serial na dużym i jasnym ekranie i rozkoszuj się wizualną ucztą dzięki szerokiej gamie kolorów DCI-P3.\"</p>',NULL,'xiaomi-redmi-note-11s-6-128gb-graphite-gray',NULL,NULL,NULL,'Xiaomi Redmi Note 11S 6/128GB Graphite Gray',NULL,NULL,NULL,NULL),
('3','1','1','\"Smartfon Xiaomi Redmi 10C 128 GB Graphite Gray\nXiaomi Redmi 10C 128 GB Graphite Gray to doskonała propozycja dla osób ceniących sobie wygodę, elegancję i płynne działanie smartfonu. Z takim urządzeniem zrobisz dobrej jakości zdjęcia z weekendowych imprez, szybko otworzysz kolejną aplikację lub włączysz ulubiony serial. Dzięki zabezpieczeniom w postaci czytnika linii papilarnych i skanera twarzy masz pewność, że nikt poza Tobą nie odblokuje Twojego telefonu.\"',NULL,'xiaomi-redmi-10c-4-128gb-graphite-gray-nfc',NULL,NULL,NULL,'Xiaomi Redmi 10C 4/128GB Graphite Gray NFC',NULL,NULL,NULL,NULL),
('3','1','2','\"Smartfon Xiaomi Redmi 10C 128 GB Graphite Gray\nXiaomi Redmi 10C 128 GB Graphite Gray to doskonała propozycja dla osób ceniących sobie wygodę, elegancję i płynne działanie smartfonu. Z takim urządzeniem zrobisz dobrej jakości zdjęcia z weekendowych imprez, szybko otworzysz kolejną aplikację lub włączysz ulubiony serial. Dzięki zabezpieczeniom w postaci czytnika linii papilarnych i skanera twarzy masz pewność, że nikt poza Tobą nie odblokuje Twojego telefonu.\"',NULL,'xiaomi-redmi-10c-4-128gb-graphite-gray-nfc',NULL,NULL,NULL,'Xiaomi Redmi 10C 4/128GB Graphite Gray NFC',NULL,NULL,NULL,NULL),
('4','1','1','\"Poznaj Xiaomi Redmi Note 11 w 100 sekund\nObejrzyj poniższy materiał wideo i dowiedz się, jakie zalety posiada Xiaomi Redmi Note 11. W jedyne 100 sekund zapoznaj się z produktem i odkryj jego najważniejsze cechy.\"',NULL,'xiaomi-redmi-note-11-4-128gb-graphite-gray',NULL,NULL,NULL,'Xiaomi Redmi Note 11 4/128GB Graphite Gray',NULL,NULL,NULL,NULL),
('4','1','2','\"Poznaj Xiaomi Redmi Note 11 w 100 sekund\nObejrzyj poniższy materiał wideo i dowiedz się, jakie zalety posiada Xiaomi Redmi Note 11. W jedyne 100 sekund zapoznaj się z produktem i odkryj jego najważniejsze cechy.\"',NULL,'xiaomi-redmi-note-11-4-128gb-graphite-gray',NULL,NULL,NULL,'Xiaomi Redmi Note 11 4/128GB Graphite Gray',NULL,NULL,NULL,NULL),
('5','1','1','\"Smartfon Samsung Galaxy S21 FE\nPoznaj Samsung Galaxy S21 FE, czyli smartfon stworzony dla wymagających użytkowników. Ciesz się niespotykaną szybkością działania, sprawnie poruszaj się między aplikacjami i pamiętaj, że pojemna bateria zagwarantuje Ci wiele godzin świetnej zabawy. Rób ciekawe zdjęcia w wysokiej rozdzielczości i dziel się nimi za pośrednictwem mediów społecznościowych.\"',NULL,'samsung-galaxy-s21-fe-5g-fan-edition-grey',NULL,NULL,NULL,'Samsung Galaxy S21 FE 5G Fan Edition Grey',NULL,NULL,NULL,NULL),
('5','1','2','\"Smartfon Samsung Galaxy S21 FE\nPoznaj Samsung Galaxy S21 FE, czyli smartfon stworzony dla wymagających użytkowników. Ciesz się niespotykaną szybkością działania, sprawnie poruszaj się między aplikacjami i pamiętaj, że pojemna bateria zagwarantuje Ci wiele godzin świetnej zabawy. Rób ciekawe zdjęcia w wysokiej rozdzielczości i dziel się nimi za pośrednictwem mediów społecznościowych.\"',NULL,'samsung-galaxy-s21-fe-5g-fan-edition-grey',NULL,NULL,NULL,'Samsung Galaxy S21 FE 5G Fan Edition Grey',NULL,NULL,NULL,NULL),
('6','1','1','\"ASUS ZenFone 8 8/128 GB Black\nStylowy i wydajny ASUS ZenFone 8 8/128 GB Black łączy w sobie wysoką moc z dużym komfortem obsługi. Kluczem do sukcesu jest najnowocześniejszy procesor Qualcomm® Snapdragon™ 888. Smartfon wykona wszystkie Twoje polecenia bez żadnych opóźnień. Zrób zdjęcia profesjonalnym systemem aparatów, który wykona najlepszej jakości fotografie. Obejrzysz je na 120 Hz ekranie AMOLED. A dzięki baterii o pojemności 4000 mAh ZenFone 8 da Ci nieprzerwaną rozrywkę przez długie godziny.\"',NULL,'asus-zenfone-8-8-128gb-black',NULL,NULL,NULL,'ASUS ZenFone 8 8/128GB Black',NULL,NULL,NULL,NULL),
('6','1','2','\"ASUS ZenFone 8 8/128 GB Black\nStylowy i wydajny ASUS ZenFone 8 8/128 GB Black łączy w sobie wysoką moc z dużym komfortem obsługi. Kluczem do sukcesu jest najnowocześniejszy procesor Qualcomm® Snapdragon™ 888. Smartfon wykona wszystkie Twoje polecenia bez żadnych opóźnień. Zrób zdjęcia profesjonalnym systemem aparatów, który wykona najlepszej jakości fotografie. Obejrzysz je na 120 Hz ekranie AMOLED. A dzięki baterii o pojemności 4000 mAh ZenFone 8 da Ci nieprzerwaną rozrywkę przez długie godziny.\"',NULL,'asus-zenfone-8-8-128gb-black',NULL,NULL,NULL,'ASUS ZenFone 8 8/128GB Black',NULL,NULL,NULL,NULL),
('7','1','1','\"Smartfon Xiaomi Redmi Note 11S 64 GB Graphite Gray\nXiaomi Redmi Note 11S 64 GB Graphite Gray to smartfon, który oferuje świetny stosunek ceny do jakości. Z nim każde zadanie realizujesz szybko i bez zbędnych przeszkód. Zaoszczędzisz dzięki temu sporo czasu, który możesz przeznaczyć na chwilę rozrywki. A ta na Redmi Note 11S stoi zawsze na wysokim poziomie. Granie w gry, oglądanie filmów czy samo skrolowanie potrali społecznościowych jest bardzo wygodne. Daj mu szansę, a z pewnością Cię nie zawiedzie.\"',NULL,'xiaomi-redmi-note-11s-6-64gb-graphite-gray',NULL,NULL,NULL,'Xiaomi Redmi Note 11S 6/64GB Graphite Gray',NULL,NULL,NULL,NULL),
