('147','1','1','\"Laptop biznesowy Dell Vostro 3510\nBiznesowy laptop Dell Vostro 3510 to styl i wydajność w klasie premium. W trosce o bezpieczeństwo Twoich danych firma Dell stworzyła urządzenia posiadające szeroką gamę rozmaitych zabezpieczeń. Z kolei nowoczesny procesor Intel Core pozwoli Ci realizować najbardziej wymagające zadania, a wszystko płynnie i bez zakłóceń. Praca w terenie? Z wydajną, świetnie zoptymalizowaną baterią w końcu przestaniesz rozglądać się nerwowo za źródłem zasilania.\"',NULL,'dell-vostro-3510-i5-1135g7-16gb-512-win11p',NULL,NULL,NULL,'Dell Vostro 3510 i5-1135G7/16GB/512/Win11P',NULL,NULL,NULL,NULL),
('147','1','2','\"Laptop biznesowy Dell Vostro 3510\nBiznesowy laptop Dell Vostro 3510 to styl i wydajność w klasie premium. W trosce o bezpieczeństwo Twoich danych firma Dell stworzyła urządzenia posiadające szeroką gamę rozmaitych zabezpieczeń. Z kolei nowoczesny procesor Intel Core pozwoli Ci realizować najbardziej wymagające zadania, a wszystko płynnie i bez zakłóceń. Praca w terenie? Z wydajną, świetnie zoptymalizowaną baterią w końcu przestaniesz rozglądać się nerwowo za źródłem zasilania.\"',NULL,'dell-vostro-3510-i5-1135g7-16gb-512-win11p',NULL,NULL,NULL,'Dell Vostro 3510 i5-1135G7/16GB/512/Win11P',NULL,NULL,NULL,NULL),
('148','1','1','\"Laptop gamingowy HP Victus 15\nWydajny, elegancki, stworzony z myślą o graczach – laptop HP Victus 15 wprowadzi Cię na wyższy poziom rozgrywek e-sportowych. Nowoczesny, potężny procesor wspomagany przez ultraszybką pamięć i kartę graficzną pozwoli Ci wyzwolić moc, którą przekujesz na zwycięstwa w wirtualnych bataliach. Ciesz się nieprzeciętną wydajnością i wejdź na wyższy level grania, dzięki niezwykłym technologiom zastosowanym w laptopie HP Victus 15.\n*Akcesoria na zdjęciach nie są częścią zestawu.\"',NULL,'hp-victus-15-ryzen-5-5600h-16gb-512-win11x-gtx1650-144hz',NULL,NULL,NULL,'HP Victus 15 Ryzen 5-5600H/16GB/512/Win11x GTX1650 144Hz',NULL,NULL,NULL,NULL),
('148','1','2','\"Laptop gamingowy HP Victus 15\nWydajny, elegancki, stworzony z myślą o graczach – laptop HP Victus 15 wprowadzi Cię na wyższy poziom rozgrywek e-sportowych. Nowoczesny, potężny procesor wspomagany przez ultraszybką pamięć i kartę graficzną pozwoli Ci wyzwolić moc, którą przekujesz na zwycięstwa w wirtualnych bataliach. Ciesz się nieprzeciętną wydajnością i wejdź na wyższy level grania, dzięki niezwykłym technologiom zastosowanym w laptopie HP Victus 15.\n*Akcesoria na zdjęciach nie są częścią zestawu.\"',NULL,'hp-victus-15-ryzen-5-5600h-16gb-512-win11x-gtx1650-144hz',NULL,NULL,NULL,'HP Victus 15 Ryzen 5-5600H/16GB/512/Win11x GTX1650 144Hz',NULL,NULL,NULL,NULL),
('149','1','1','\"Laptop biznesowy Huawei MateBook B3-520\nHuawei MateBook B3-520 to biznesowy laptop, z którym bez problemów ukończysz wszystkie zadania, niezależnie od tego, gdzie zabierze Cię Twoja praca. To lekkie, mobilne urządzenie z ekranem o przekątnej 15,6” umożliwia całodniową pracę i zapewnia zgodność ze starszymi technologiami stosowanymi w firmie. Oferuje również legendarną niezawodność oraz zabezpieczenia klasy korporacyjnej. Niezwykle szeroka gama portów, opcje bezprzewodowej łączności czy wysokiej jakości wyświetlacz Full HD z pewnością przełożą się na komfort Twojej pracy.\n\n*Widoczne na zdjęciach dodatkowe urządzenia nie wchodzą w skład zestawu.\"',NULL,'huawei-matebook-b3-520-i5-1135g7-8gb-512-win10pro-srebrny',NULL,NULL,NULL,'Huawei MateBook B3-520 i5-1135G7/8GB/512/Win10Pro srebrny',NULL,NULL,NULL,NULL),
