('150','1','1','\"Uniwersalny laptop Lenovo IdeaPad 3-15\nPoznaj Lenovo IdeaPad 3-15. Wyjątkową serię laptopów, która sprosta Twoim oczekiwaniom. Nowoczesny procesor oraz zintegrowana karta graficzna zagwarantują Ci optymalną wydajność. Lenovo IdeaPad 3-15 sprawdzi się zarówno jako narzędzie do pracy biurowej, jak i centrum filmowo-gamingowej rozrywki. Podziwiaj naturalne kolory wyświetlane na ekranie w rozdzielczości Full HD.\"',NULL,'lenovo-ideapad-3-15-ryzen-5-5500u-16gb-512-win11',NULL,NULL,NULL,'Lenovo IdeaPad 3-15 Ryzen 5 5500U/16GB/512/Win11',NULL,NULL,NULL,NULL),
