('151','1','1','\"Dell G15 5515 – optymalne połączenie pracy i rozrywki\nPoznaj laptopa Dell G15, następcę kultowych modeli G3 i G5, o 15,6-calowym ekranie i odświeżaniu do 120 Hz. Model ten precyzyjnie łączy przeznaczenie do pracy czy nauki z pasjami oraz czasem wolnym. W szczególności odpowiada na wymagające potrzeby fanów gamingu.\nChłodzenie na poziomie najlepszych laptopów w swojej klasie\nOryginalny design i wytrzymała konstrukcja\nObsługa serwisowa klasy biznes\"',NULL,'dell-inspiron-g15-ryzen-5-5600h-16gb-512-win11-rtx3050',NULL,NULL,NULL,'Dell Inspiron G15 Ryzen 5 5600H/16GB/512/Win11 RTX3050',NULL,NULL,NULL,NULL),
