('152','1','2','\"Dell Inspiron 15 5515 Ryzen Edition\nCenisz sobie swobodę i elastyczność, jaką daje Ci zdalna praca, ale wymagasz wygody i niezawodności od swojego sprzętu? Odkryj Inspirona 15 z serii 5000 – laptopa, który dotrzyma Ci kroku.\nDoskonały procesor AMD Ryzen 5000 z grafiką Radeon\nWydajna bateria, którą naładujesz od 0 do 80% już w godzinę (ExpressCharge)\nWybierz gwarancję produktywności niezależnie od miejsca czy zadania\"',NULL,'dell-inspiron-5515-ryzen-5-5500u-16gb-512-win11',NULL,NULL,NULL,'Dell Inspiron 5515 Ryzen 5 5500U/16GB/512/Win11',NULL,NULL,NULL,NULL),
('153','1','1','\"Laptop uniwersalny ASUS X515EA\nPoznaj uniwersalny laptop ASUS X515EA, serię laptopów stworzonych z myślą o Twojej wygodzie. Wyposażone w wydajny procesor oraz zintegrowany układ graficzny są w stanie sprostać zarówno prostym codziennym obowiązkom, jak i realizować wymagające zadania. Ciesz się wysoką jakością wyświetlanego obrazu w rozdzielczości Full HD, a matowa powłoka matrycy zadba o to, by obraz był wyświetlany odpowiednio w każdych warunkach.\"',NULL,'asus-x515ea-bq3086w-i5-1135g7-16gb-512-win11',NULL,NULL,NULL,'ASUS X515EA-BQ3086W i5-1135G7/16GB/512/Win11',NULL,NULL,NULL,NULL),
