('156','1','1','\"Usługa Premium Care\nZyskaj zaawansowane wsparcie od najlepszych techników.\nProsty kontakt – przez telefon, czat lub e-mail .\nDoradctwo – szybkie rozwiązania niezależnie od problemu, przy pierwszym kontakcie. W razie potrzeby zespół Lenovo zaplanuje wizytę na miejscu na następny dzień roboczy.\nBez wysiłku – pomoc „Rozpoczęcie pracy” i „jak to zrobić” w zakresie sprzętu, oprogramowania i urządzeń peryferyjnych. Proste rozwiązania, do których łatwo dotrzeć.\nKontrola stanu komputera – Coroczna kontrola stanu komputera, która pozwala wykryć problemy przed Tobą, szybko je rozwiązać i pomóc Ci uniknąć zbędnych zmartwień.\"',NULL,'lenovo-legion-5-15-ryzen-5-16gb-512-win11-rtx3060-165hz',NULL,NULL,NULL,'Lenovo Legion 5-15 Ryzen 5/16GB/512/Win11 RTX3060 165Hz',NULL,NULL,NULL,NULL),
