('157','1','1','\"Laptop gamingowy ASUS ROG Strix G15\nWydajny, elegancki, stworzony z myślą o graczach – laptop ASUS ROG Strix G15 wprowadzi Cię na wyższy poziom rozgrywek e-sportowych. Nowoczesny, potężny procesor wspomagany przez ultraszybką pamięć i kartę graficzną pozwoli Ci wyzwolić moc, którą przekujesz na zwycięstwa w wirtualnych bataliach. Ciesz się nieprzeciętną wydajnością i wejdź na wyższy level grania, dzięki niezwykłym technologiom zastosowanym w laptopie ASUS ROG Strix G15.\"',NULL,'asus-rog-strix-g15-r7-4800h-16gb-512-w11-rtx3060-144hz',NULL,NULL,NULL,'ASUS ROG Strix G15 R7-4800H/16GB/512/W11 RTX3060 144Hz',NULL,NULL,NULL,NULL),
