('160','1','2','\"Odkryj uniwersalny laptop HUAWEI MateBook D 15 w 360 stopniach\nHUAWEI MateBook D 15 to idealny kompan codziennych zadań. Niezależnie, czy potrzebujesz go do pracy, czy rozrywki sprosta on nawet najbardziej wymagającym użytkownikom. Dzięki szybkiej pamięci działającej w trybie dwukanałowym, możesz pracować w kilku aplikacjach jednocześnie. W trosce o Twoje oczy zastosowany w laptopie ekran posiada technologię redukującą emisję szkodliwego, niebieskiego światła oraz migotania obrazu. Potwierdza to podwójny certyfikat TÜV Rheinland.\nSprawdź, jak HUAWEI MateBook D 15 wygląda w rzeczywistości. Chwyć zdjęcie poniżej i przeciągnij je w lewo lub prawo, aby obrócić produkt lub skorzystaj z przycisków nawigacyjnych. Najedź kursorem na wyróżniony punkt, by uzyskać więcej informacji o danym elemencie.\n(function(self) {\r let ud = \'undefined\',\r od = \'orbitvu_domready\',\r og = \'orbitvu_global_scripts\',\r os = \'inject_orbitvu_scripts\';\r if (typeof(self[od]) === ud) {\r let t = [],\r n, r = !1,\r i = document,\r u = \"DOMContentLoaded\",\r h = /^loaded|c/.test(i.readyState);\r \r function p(e) {\r h = 1;\r while (e = t.shift()) e()\r }\r i.addEventListener(u, n = function() {\r i.removeEventListener(u, n, r);\r p()\r }, r);\r self[od] = function(e) {\r h ? e() : t.push(e)\r }\r }\r if (typeof(self[og]) === ud) {\r self[og] = []\r }\r if (typeof(self[os]) === ud) {\r let orbitvu_head = document.getElementsByTagName(\'head\')[0] || document.documentElement;\r self[os] = function(script) {\r if (self[og].indexOf(script) === -1) {\r self[og].push(script);\r let script_orbitvu = document.createElement(\'script\');\r script_orbitvu.src = script;\r script_orbitvu.async = true;\r script_orbitvu.type = \'text/javascript\';\r orbitvu_head.appendChild(script_orbitvu)\r }\r }\r }\r })(window);\r \r inject_orbitvu_scripts(\'https://cdn.orbitvu.co/orbittour/8917cf2e/orbittour.js\');\r \r function inject_orbittour_W2brQ5rvocHq75icai8yjJ() {\r if (typeof(Orbittour) !