('161','1','1','\"Laptop ultramobilny ASUS ZenBook 14 UM425QA\nElegancja do pary z wygodą użytkowania? To właśnie oferuje ultramobilny laptop ASUS ZenBook 14 UM425QA, który świetnie sprawdzi się zarówno jako narzędzie do pracy, jak i multimedialne centrum rozrywki, na którym zobaczysz kolejne sezony swoich ulubionych seriali. Do dyspozycji masz również wiele inteligentnych rozwiązań. A smukła konstrukcja oraz niewielka waga pozwolą Ci zabrać go ze sobą wszędzie, gdzie zechcesz. Zaufaj mobilności bez kompromisów.\"',NULL,'asus-zenbook-14-um425qa-r5-5600h-16gb-512-win11',NULL,NULL,NULL,'ASUS ZenBook 14 UM425QA R5-5600H/16GB/512/Win11',NULL,NULL,NULL,NULL),
