('182','1','1','\"Laptop biznesowy HP 250 G9\nCo czyni laptop HP 250 G9 wyjątkowym? Po pierwsze – smukła, cienka konstrukcja, która zachwyca nie tylko designem, ale i solidnością wykonania. Po drugie – łatwość obsługi i bezpieczeństwo klasy korporacyjnej, a wszystko to w zgodzie zarówno z nowymi, jak i starszymi technologiami. HP 250 G9 świetnie sprawdzi się we wszystkich firmach, które poszukują sprzętu przystępnego cenowo, a jednocześnie spełniającego nowoczesne standardy w kwestii wydajności i bezpieczeństwa.\nWolisz korzystać z systemu operacyjnego Windows 10? Kwestia przyzwyczajenia, brak zgodności programów – to bez znaczenia. Zdecyduj, czy wolisz pozostać przy zainstalowanym na tym laptopie Windows 11, czy przywrócisz go do poprzedniej wersji.\"',NULL,'hp-250-g9-i5-1235u-16gb-512-win11p',NULL,NULL,NULL,'HP 250 G9 i5-1235U/16GB/512/Win11P',NULL,NULL,NULL,NULL),
