('200','1','1','\"Laptop gamingowy Lenovo IdeaPad Gaming 3-15\nLenovo IdeaPad Gaming 3-15 powstał w jednym celu – aby wprowadzić Cię na najwyższe szczeble gamingowej drabiny. Tam, gdzie technologia Ray Tracingu czyni wirtualne światy jeszcze bardziej realistycznymi, a fps-y utrzymują się na poziomie zapewniającym komfortową rozgrywkę. Wewnątrz laptopa na Twoje e-sportowe sukcesy pracują m.in.: ultrawydajny procesor oraz karta graficzna GeForce RTX. Efekty ich pracy ujrzysz w rozdzielczości Full HD na wysokiej jakości ekranie. Podejmij wyzwanie i dołącz do wirtualnych pojedynków z laptopem Lenovo IdeaPad Gaming 3-15.\"',NULL,'lenovo-ideapad-gaming-3-15-i7-16gb-512-win11-rtx3050-120hz',NULL,NULL,NULL,'Lenovo IdeaPad Gaming 3-15 i7/16GB/512/Win11 RTX3050 120Hz',NULL,NULL,NULL,NULL),
