INSERT INTO `ps_product_lang` VALUES
('201','1','1','\"Laptop biznesowy HP 15s\nHP 15s to biznesowy laptop, z którym bez problemów ukończysz wszystkie zadania, niezależnie od tego, gdzie zabierze Cię Twoja praca. To lekkie, mobilne urządzenie z ekranem o przekątnej 15,6” umożliwia całodniową pracę i zapewnia zgodność ze starszymi technologiami stosowanymi w firmie. Niezwykle szeroka gama portów, opcje bezprzewodowej łączności czy wysokiej jakości wyświetlacz Full HD z pewnością przełożą się na komfort Twojej pracy.\"',NULL,'hp-15s-ryzen-5-5625u-16gb-512-win11-silver',NULL,NULL,NULL,'HP 15s Ryzen 5-5625U/16GB/512/Win11 Silver',NULL,NULL,NULL,NULL),
