('202','1','1','\"Niektóre laptopy mogą mieć zainstalowany system operacyjny Windows 10. Dzieje się tak, kiedy producent wprowadza na linię produkcyjną nowe oprogramowanie. Możesz samodzielnie zaktualizować system do Windowsa 11. Jest to w pełni darmowe.\"',NULL,'hp-15s-ryzen-5-5500-16gb-512-win11-ips-black',NULL,NULL,NULL,'HP 15s Ryzen 5-5500/16GB/512/Win11 IPS Black',NULL,NULL,NULL,NULL),
