('203','1','1','\"Laptop gamingowy ASUS TUF Gaming F15\nGotuj się do walki. Gamingowy laptop ASUS TUF Gaming F15 wprowadzi Cię na pola wirtualnych bitew, oddając do dyspozycji arsenał, który poprowadzi Cię do niezliczonych zwycięstw. Wyposażony został w wyselekcjonowane, ultrawydajne komponenty -– nowoczesny procesor oraz dedykowaną kartę graficzną. Z takim zapleczem technologicznym Twoi rywale mogą co najwyżej przygotowywać się do odwrotu.\"',NULL,'asus-tuf-gaming-f15-i5-10300h-8gb-512-gtx1650-144hz',NULL,NULL,NULL,'ASUS TUF Gaming F15 i5-10300H/8GB/512 GTX1650 144Hz',NULL,NULL,NULL,NULL),
('203','1','2','\"Laptop gamingowy ASUS TUF Gaming F15\nGotuj się do walki. Gamingowy laptop ASUS TUF Gaming F15 wprowadzi Cię na pola wirtualnych bitew, oddając do dyspozycji arsenał, który poprowadzi Cię do niezliczonych zwycięstw. Wyposażony został w wyselekcjonowane, ultrawydajne komponenty -– nowoczesny procesor oraz dedykowaną kartę graficzną. Z takim zapleczem technologicznym Twoi rywale mogą co najwyżej przygotowywać się do odwrotu.\"',NULL,'asus-tuf-gaming-f15-i5-10300h-8gb-512-gtx1650-144hz',NULL,NULL,NULL,'ASUS TUF Gaming F15 i5-10300H/8GB/512 GTX1650 144Hz',NULL,NULL,NULL,NULL),
