('204','1','2','\"Laptop uniwersalny HP 15s\nHP 15s to laptop, który sprawdzi się na wielu frontach. Energooszczędny procesor w parze z wydajnym zintegrowanym układem graficznym przełożą się na wysoką wydajność w popularnych grach, a matowy ekran Full HD szybko stanie się Twoim oknem na ulubione filmy i seriale. Z kolei dzięki szerokiej gamie złączy z łatwością podłączysz go do wielu urządzeń zewnętrznych, wykorzystując go jako laptop biurowy. Postaw na uniwersalność, postaw na HP 15s.\"',NULL,'hp-15s-i5-1155g7-16gb-512-win11-ips-gold',NULL,NULL,NULL,'HP 15s i5-1155G7/16GB/512/Win11 IPS Gold',NULL,NULL,NULL,NULL),
('205','1','1','\"Laptop uniwersalny ASUS VivoBook D1502\nLaptopy ASUS VivoBook D1502 to połączenie nowoczesnych technologicznych rozwiązań z elegancki designem. Lekka, wytrzymała obudowa przyciąga wzrok swoją ciekawą estetyką, a starannie dobrane komponenty tworzą zgraną całość, która daje o sobie znać wysoką wydajnością. O satysfakcjonującą mobilność dba pojemna, świetnie zoptymalizowana bateria, a szeroka gama złączy pozwoli Ci połączyć swój notebook ASUS VivoBook D1502 z wieloma urządzeniami zewnętrznymi jednocześnie.\"',NULL,'asus-vivobook-d1502ia-r5-4600h-16gb-512-win11',NULL,NULL,NULL,'ASUS VivoBook D1502IA R5-4600H/16GB/512/Win11',NULL,NULL,NULL,NULL),
