('298','1','1','\"Laptop uniwersalny Lenovo IdeaPad 3-15\nLenovo IdeaPad 3-15 to laptop, który sprawdzi się na wielu frontach. Energooszczędny procesor w parze ze zintegrowanym układem graficznym przełożą się na wysoką wydajność w popularnych grach, a matowy ekran Full HD szybko stanie się Twoim oknem na ulubione filmy i seriale. Z kolei dzięki szerokiej gamie złączy z łatwością podłączysz go do wielu urządzeń zewnętrznych, wykorzystując go jako laptop biurowy. Postaw na uniwersalność, postaw na Lenovo IdeaPad 3-15.\"',NULL,'lenovo-ideapad-3-15-ryzen-3-12gb-512-win11',NULL,NULL,NULL,'Lenovo IdeaPad 3-15 Ryzen 3/12GB/512/Win11',NULL,NULL,NULL,NULL),
