('299','1','1','\"Dell Inspiron 15 5515 Ryzen Edition\nCenisz sobie swobodę i elastyczność, jaką daje Ci zdalna praca, ale wymagasz wygody i niezawodności od swojego sprzętu? Odkryj Inspirona 15 z serii 5000 – laptopa, który dotrzyma Ci kroku.\nDoskonały procesor AMD Ryzen 5000 z grafiką Radeon\nWydajna bateria, którą naładujesz od 0 do 80% już w godzinę (ExpressCharge)\nWybierz gwarancję produktywności niezależnie od miejsca czy zadania\"',NULL,'dell-inspiron-5515-ryzen-5-5500u-16gb-512-win11',NULL,NULL,NULL,'Dell Inspiron 5515 Ryzen 5 5500U/16GB/512/Win11',NULL,NULL,NULL,NULL),
('299','1','2','\"Dell Inspiron 15 5515 Ryzen Edition\nCenisz sobie swobodę i elastyczność, jaką daje Ci zdalna praca, ale wymagasz wygody i niezawodności od swojego sprzętu? Odkryj Inspirona 15 z serii 5000 – laptopa, który dotrzyma Ci kroku.\nDoskonały procesor AMD Ryzen 5000 z grafiką Radeon\nWydajna bateria, którą naładujesz od 0 do 80% już w godzinę (ExpressCharge)\nWybierz gwarancję produktywności niezależnie od miejsca czy zadania\"',NULL,'dell-inspiron-5515-ryzen-5-5500u-16gb-512-win11',NULL,NULL,NULL,'Dell Inspiron 5515 Ryzen 5 5500U/16GB/512/Win11',NULL,NULL,NULL,NULL),
('300','1','1','\"Laptop gamingowy ASUS TUF Gaming F15\nStworzony pod kątem poważnej rozgrywki i zapewnienia wysokiej wytrzymałości w codziennym użytkowaniu laptop TUF Gaming F15 to doskonale wyposażona maszyna gamingowa, która będzie towarzyszyła Ci podczas kolejnych zwycięstw. Dzięki zastosowaniu procesora Intel® Core™ 11. generacji i karty graficznej GeForce® RTX z serii 3000 – nawet najszybsza akcja rozgrywki będzie dynamiczna i płynna.\nW pełni wykorzystaj możliwości matrycy o częstotliwości odświeżania sięgającej 144 Hz. Wydajny samooczyszczający się układ chłodzenia w połączeniu z typową dla sprzętu marki TUF wytrzymałością klasy wojskowej czynią z niego zaprawionego w bojach wojownika i potężnego sojusznika dla każdego gracza.\"',NULL,'asus-tuf-gaming-f15-i5-11400h-16gb-512-win11-rtx3060-144hz',NULL,NULL,NULL,'ASUS TUF Gaming F15 i5-11400H/16GB/512/Win11 RTX3060 144Hz',NULL,NULL,NULL,NULL),
