('307','1','1','\"Laptop gamingowy MSI GF76\nMSI GF76 powstał w jednym celu – aby wprowadzić Cię na najwyższe szczeble gamingowej drabiny. Tam, gdzie technologia Ray Tracingu czyni wirtualne światy jeszcze bardziej realistycznymi, a fps-y utrzymują się na poziomie zapewniającym komfortową rozgrywkę. Wewnątrz laptopa na Twoje e-sportowe sukcesy pracują m.in.: ultrawydajny procesor oraz karta graficzna GeForce RTX. Efekty ich pracy ujrzysz w rozdzielczości Full HD na wysokiej jakości ekranie. Podejmij wyzwanie i dołącz do wirtualnych pojedynków z laptopem MSI GF76.\"',NULL,'msi-gf76-i7-11800h-16gb-512-rtx3050-144hz',NULL,NULL,NULL,'MSI GF76 i7-11800H/16GB/512 RTX3050 144Hz',NULL,NULL,NULL,NULL),
