('326','1','1','\"Dell Inspiron 14 5415 – mobilność w doskonałym wydaniu\nWykorzystuj w pełni każdy dzień, gdziekolwiek jesteś. Nowy Inspiron 14 5415 da Ci swobodę, którą kochasz i doskonałą jakość pracy, jakiej oczekujesz. W tym eleganckim, niewielkim urządzeniu zamknięta jest technologia najnowszej generacji, którą bez problemu zabierzesz ze sobą wszędzie. Notebook imponuje elegancją i minimalistyczną formą. Ultra cienki, smukły i lekki zachwyci Ćię od pierwszego wejrzenia.\nWydajna praca z procesorem AMD Ryzen z serii 5000,\nUlepszona bateria, którą naładujesz od 0 do 80% już w godzinę (ExpressCharge),\nWaży niespełna 1,38 kg, więc możesz się z nim nie rozstawać.\"',NULL,'dell-inspiron-5415-ryzen-5-5500u-16gb-512-win11',NULL,NULL,NULL,'Dell Inspiron 5415 Ryzen 5-5500U/16GB/512/Win11',NULL,NULL,NULL,NULL),
