('327','1','1','\"Laptop gamingowy Gigabyte AORUS 5\nGigabyte AORUS 5 powstał w jednym celu – aby wprowadzić Cię na najwyższe szczeble gamingowej drabiny. Tam, gdzie technologia Ray Tracingu czyni wirtualne światy jeszcze bardziej realistycznymi, a fps-y utrzymują się na poziomie zapewniającym komfortową rozgrywkę. Wewnątrz laptopa na Twoje e-sportowe sukcesy pracują m.in.: ultrawydajny procesor oraz karta graficzna GeForce RTX. Efekty ich pracy ujrzysz w rozdzielczości Full HD na wysokiej jakości ekranie. Podejmij wyzwanie i dołącz do wirtualnych pojedynków z laptopem Gigabyte AORUS 5.\"',NULL,'gigabyte-aorus-5-i7-12700h-32gb-960gb-win11-rtx3070-144hz',NULL,NULL,NULL,'Gigabyte AORUS 5 i7-12700H/32GB/960GB/Win11 RTX3070 144Hz',NULL,NULL,NULL,NULL),
