('401','1','1','\"Laptop uniwersalny ASUS VivoBook 15\nSzukasz uniwersalnego laptopa? ASUS VivoBook 15 to doskonałe urządzenie, z którym możesz pracować z biura, oddać się rozrywce multimedialnej lub po prostu surfować po sieci. Ten lekki, smukły i elegancki laptop sprawdzi się w każdym zadaniu. Zaufaj wydajności, jaką oferuje Ci VivoBook 15 i rób to, na co masz ochotę.\"',NULL,'asus-vivobook-15-i5-1135g7-16gb-512-win11px',NULL,NULL,NULL,'ASUS VivoBook 15 i5-1135G7/16GB/512/Win11PX',NULL,NULL,NULL,NULL),
('401','1','2','\"Laptop uniwersalny ASUS VivoBook 15\nSzukasz uniwersalnego laptopa? ASUS VivoBook 15 to doskonałe urządzenie, z którym możesz pracować z biura, oddać się rozrywce multimedialnej lub po prostu surfować po sieci. Ten lekki, smukły i elegancki laptop sprawdzi się w każdym zadaniu. Zaufaj wydajności, jaką oferuje Ci VivoBook 15 i rób to, na co masz ochotę.\"',NULL,'asus-vivobook-15-i5-1135g7-16gb-512-win11px',NULL,NULL,NULL,'ASUS VivoBook 15 i5-1135G7/16GB/512/Win11PX',NULL,NULL,NULL,NULL),
('402','1','1','\"Laptop gamingowy ASUS ROG Strix G15\nGotuj się do walki. Gamingowy laptop ASUS ROG Strix G15 wprowadzi Cię na pola wirtualnych bitew, oddając do dyspozycji arsenał, który poprowadzi Cię do niezliczonych zwycięstw. Wyposażony został w wyselekcjonowane, ultrawydajne komponenty - nowoczesny procesor oraz dedykowaną kartę graficzną. Z takim zapleczem technologicznym Twoi rywale mogą co najwyżej przygotowywać się do odwrotu.\n*Specyfikacja może się różnić w zależności od modelu i/lub regionu.\"',NULL,'asus-rog-strix-g15-r7-6800h-16gb-512-win11-rtx3050',NULL,NULL,NULL,'ASUS ROG Strix G15 R7-6800H/16GB/512/Win11 RTX3050',NULL,NULL,NULL,NULL),
