('510','1','1','\"Laptop uniwersalny ASUS Vivobook S 16X\nOdkryj nowe możliwości z ASUS Vivobook S 16X. To wyjątkowy laptop, który łączy w sobie nowatorski styl z potężną wydajnością. Napędza go procesor Intel Core, a dodatkowo wyposażony został w zawias matrycy o kącie otwarcia 180°. Czyni to z niego idealny wybór dla osób kreatywnych, którzy po pracy chcą mieć dostęp do rozrywki w wysokiej jakości.\nJego oszałamiający wyświetlacz o proporcjach 16:10 posiada certyfikat TÜV Rheinland, by dbać o wzrok użytkowników. Przeprojektowana obudowa jest wykończona w nowych, świeżych kolorach, co zapewnia całkowicie nowy i elegancki design. Niezależnie od Twoich potrzeb, Vivobook S 16X jest dla nich odpowiedzią – więc zacznij odkrywać już teraz.\"',NULL,'asus-vivobook-s16x-i5-12500h-24gb-1tb-win11-oled',NULL,NULL,NULL,'ASUS Vivobook S16X i5-12500H/24GB/1TB/Win11 OLED',NULL,NULL,NULL,NULL),
