('553','1','1','\"Laptop gamingowy ASUS TUF Gaming F15\nStworzony pod kątem poważnej rozgrywki i zapewnienia wysokiej wytrzymałości w codziennym użytkowaniu laptop TUF Gaming F15 to doskonale wyposażona maszyna gamingowa, która będzie towarzyszyła Ci podczas kolejnych zwycięstw. Dzięki zastosowaniu procesora Intel® Core™ 11. generacji i karty graficznej GeForce® RTX z serii 3000 – nawet najszybsza akcja rozgrywki będzie dynamiczna i płynna.\nW pełni wykorzystaj możliwości matrycy o częstotliwości odświeżania sięgającej 144 Hz. Wydajny samooczyszczający się układ chłodzenia w połączeniu z typową dla sprzętu marki TUF wytrzymałością klasy wojskowej czynią z niego zaprawionego w bojach wojownika i potężnego sojusznika dla każdego gracza.\"',NULL,'asus-tuf-gaming-f15-i5-11400h-16gb-960-win11-rtx3060-144hz',NULL,NULL,NULL,'ASUS TUF Gaming F15 i5-11400H/16GB/960/Win11 RTX3060 144Hz',NULL,NULL,NULL,NULL),
